import React, {Component} from 'react';
import BoxHeaderLogo from '../logo.png';

import './App.css';
import BoxHeader from './component/BoxHeader';
import BoxHeaderButton from './component/BoxHeaderButton';

class App extends Component {
  render () {
    return (
    <div>
      <div className="BoxInit">
      <a href = "/">
      <img src={BoxHeaderLogo} className = "BoxHeaderLogo" alt="logo"/>
      </a>
      <BoxHeader/>
      </div>
    </div>  
    );
  }
}

export default App;
